ntainedTemplate":null,"Constraints":[]},{"Number":"1153-173609","Narrative":"\u003cp\u003eSHALL SUPPORT zero or one 0..1] postalCode (CONF:1153-173609).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173610","Narrative":"\u003cp\u003eSHALL SUPPORT zero or one 0..1] city (CONF:1153-173610).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173611","Narrative":"\u003cp\u003eSHALL SUPPORT zero or one 0..1] state, which SHOULD be selected from the code system ISO 3166-2 alpha codes having the OID 1.0.3166.2 (CONF:1153-173611).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173612","Narrative":"\u003cp\u003eSHALL SUPPORT address parts (part types), which SHOULD be selected from ValueSet x\u003ci\u003eBasicAddressPartType 2.16.840.1.113883.2.20.3.138 STATIC 2008-12-17\u003c/i\u003e (CONF:1153-173612).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]}]},{"Number":"1153-173613","Narrative":"\u003cp\u003eThe Canadian Realm Date and Time data type is based on TS.DATETIME flavor defined in the pan-Canadian Data Type Specification.\u003c/p\u003e\u003cp\u003eThis flavour constrains the timestamp to permit the “date”, “time” and “timezone” portions of the timestamp to be specified. Partial dates may be specified only if no time component is specified. Time may be omitted, and partial times may be specified. If a time is specified, the “timezone” portion of the timestamp must be specified. Local time is calculated as an offset of GMT (e.g. “- 0800” for Pacific Time Zone, -0500 for Eastern Time Zone).\u003c/p\u003e\u003cp\u003eThe grammar for the date/time is: YYYYDS.S]]]]]]+/-ZZZZ] (24\u003c/p\u003e\u003cp\u003echaracters) (CONF:1153-173613).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173389","Narrative":"\u003cp\u003eThe Canadian Realm Date Time Interval data type is based on IVL\u003cspan class=\"tag\"\u003e\u0026lt;TS.DATETIME\u0026gt;\u003c/span\u003e flavor defined in the pan-Canadian Data Type Specification (R02.04.05) (CONF:1153-173389).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[{"Number":"1153-173614","Narrative":"\u003cp\u003eSHALL contain 2 of the attributes: low, high and width (CONF:1153-173614).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]}]},{"Number":"1153-173390","Narrative":"\u003cp\u003eThe Canadian Realm Personal Name data type is based on PN.FULL flavor defined in the pan-Canadian Data Type Specification (R02.04.05) with additional Ontario constraints (CONF:1153-173390).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[{"Number":"1153-173615","Narrative":"\u003cp\u003eSHALL contain one 1..1] @use, which SHOULD be selected from ValueSet x\u003ci\u003eBasicPersonNameUse 2.16.840.1.113883.2.20.3.142 STATIC\u003c/i\u003e (CONF:1153-173615).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173616","Narrative":"\u003cp\u003eSHOULD contain zero to two 0..2] prefix elements (CONF:1153-173616).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173617","Narrative":"\u003cp\u003eSHALL contain zero to two 0..2] given elements (CONF:1153-173617).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173618","Narrative":"\u003cp\u003eThe first occurrence of a given name is the \"first name\". The requirement for a middle name is met through an additional repetition of \"given name\" (CONF:1153-173618).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173619","Narrative":"\u003cp\u003eSHALL contain zero or one 0..1] family element (CONF:1153-173619).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173620","Narrative":"\u003cp\u003eSHOULD contain zero to two 0..2] suffix elements (CONF:1153-173620).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173621","Narrative":"\u003cp\u003eSHALL contain name parts, which SHALL be selected from ValueSet x\u003ci\u003eBasicPersonNamePartType STATIC 2008-12-17\u003c/i\u003e (CONF:1153-173621).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173622","Narrative":"\u003cp\u003eEach part SHALL be constrained to a maximum of 75 characters (CONF:1153-173622).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173623","Narrative":"\u003cp\u003eThe minimal number of name parts SHALL be 1 (CONF:1153-173623).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173624","Narrative":"\u003cp\u003eThe maximal number of name parts SHALL be 7 (CONF:1153-173624).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]}]},{"Number":"1153-173391","Narrative":"\u003cp\u003eThe Canadian Realm Telecom data type is based on TEL.ALL flavor defined in the pan-Canadian Data Type Specification (CONF:1153-173391).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[{"Number":"1153-173625","Narrative":"\u003cp\u003eSHALL contain one 1..1] @use, which SHOULD be selected from ValueSet x\u003ci\u003eBasicTelecommunicationAddressUse 2.16.840.1.113883.2.20.3.144 STATIC\u003c/i\u003e (CONF:1153-173625).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173626","Narrative":"\u003cp\u003eSHALL contain one 1..1] attribute value and the content SHOULD follow the specifications as described in http://www.ietf.org/rfc/rfc3966.txt (CONF:1153-173626).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]}]},{"Number":"1153-173392","Narrative":"\u003cp\u003eThe Canadian Realm II data type is based on II flavor defined in the pan-Canadian Data Type Specification (R02.04.05) (CONF:1153-173392).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[{"Number":"1153-173627","Narrative":"\u003cp\u003eSHALL contain exactly one 1..1] II.root which SHALL NOT contain nullFlavor. It is constrained to either an OID or a UUID (GUID) and has a maximum length of 200 characters (CONF:1153-173627).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]},{"Number":"1153-173628","Narrative":"\u003cp\u003eSHALL SUPPORT zero or one 0..1] II.extension which has a maximum of 50 characters. It is considered case-sensitive for comparison purposes. Non-case-sensitive identifiers should be exchanged in upper-case. There are no further restrictions on the extension component (CONF:1153-173628).\u003c/p\u003e","Context":null,"Value":null,"Cardinality":null,"Conformance":"SHALL","DataType":null,"ValueSetIdentifier":null,"ValueSetDate":null,"IsChoice":false,"ContainedTemplate":null,"Constraints":[]}]}]},{"Identifier":"urn:hl7ii:2.16.840.1.113883.10.20.22.4.19:2014-06-09","Bookmark":"Indication_V2","Name":"Indication (V2)","Description":"\u003cp\u003eThis template represents the rationale for an action such as an encounter, a medication administration, or a procedure. The id element can be used to reference a problem recorded elsewhere in the document, or can be used with a code and value to record the problem. Indications for treatment are not laboratory results; rather the problem associated with the laboratory result should be sited (e.g., hypokalemia instead of a laboratory result of Potassium 2.0 mEq/L). Use the Drug Monitoring Act [templateId 2.16.840.1.113883.10.20.22.4.123] to indicate if a particular drug needs special monitoring (e.g., anticoagulant therapy). Use Precondition for Substance Administration (V2) [templateId 2.16.840.1.113883.10.20.22.4.25.2] to represent that a medication is to be administered only when the associated criteria are met.\u003c/p\u003e","ContextType":"Observation","Context":"observation","Extensibility":"Open","TemplateTypeId":3,"Changes":{"Id":3723,"IsAdded":false,"TemplateName":"Indication (V2)","PreviousTemplateName":"Indication (urn:oid:2.16.840.1.113883.10.20.22.4.19)","PreviousTemplateId":635,"Difference":{"ChangedFields":[{"Name":"Name","Old":"Indication","New":"Indication (V2)"},{"Name":"Oid","Old":"urn:oid:2.16.840.1.113883.10.20.22.4.19","New":"urn:hl7ii:2.16.840.1.113883.10.20.22.4.19:2014-06-09"},{"Name":"Description","Old":"The Indication Observation documents the rationale for an activity. It can do this with the id element to reference a problem recorded elsewhere in the document or with a code and value to record the problem type and problem within the Indication. For example, the indication for a prescription of a painkiller might be a headache that is documented in the Problems Section.","New":"This template represents the rationale for an action such as an encounter, a medication administration, or a procedure. The id element can be used to reference a problem recorded elsewhere in the document, or can be used with a code and value to record the problem. Indications for treatment are not laboratory results; rather the problem associated with the laboratory result should be sited (e.g., hypokalemia instead of a laboratory result of Potassium 2.0 mEq/L). Use the Drug Monitoring Act [[]templateId 2.16.840.1.113883.10.20.22.4.123] to indicate if a particular drug needs special monitoring (e.g., anticoagulant therapy). Use Precondition for Substance Administration (V2) [[]templateId 2.16.840.1.113883.10.20.22.4.25.2] to represent that a medication is to be administered only when the associated criteria are met."}],"ChangedConstraints":[{"Type":0,"Number":"1098-31229","ParentNumber":null,"Order":5,"OldNarrative":null,"NewNarrative":"SHALL contain exactly one [1..1] code, which MAY be selected from ValueSet Problem Type urn:oid:2.16.840.1.113883.3.88.12.3221.7.2 STATIC 2014-09-02 (CONF:1098-31229).","ChangedFields":[]},{"Type":0,"Number":"1098-32570","ParentNumber":"1098-7482","Order":2,"OldNarrative":null,"NewNarrative":"SHALL contain exactly one [1..1] @extension=\"2014-06-09\" (CONF:1098-32570).","ChangedFields":[]},{"Type":2,"Number":"81-15985","ParentNumber":"81-7489","Order":2,"OldNarrative":"The value, if present, SHOULD contain zero or one [0..1] @code, which SHOULD be selected from ValueSet Problem urn:oid:2.16.840.1.113883.3.88.12.3221.7.4 DYNAMIC (CONF:81-15985).","NewNarrative":null,"ChangedFields":[]},{"Type":2,"Number":"81-15990","ParentNumber":"81-7489","Order":1,"OldNarrative":"The value, if present, MAY contain zero or one [0..1] @nullFlavor (CONF:81-15990).","NewNarrative":null,"ChangedFields":[]},{"Type":2,"Number":"81-15991","ParentNumber":"81-15990","Order":1,"OldNarrative":"If the diagnosis is unknown or the SNOMED code is unknown, @nullFlavor SHOULD be “UNK”. If the code is something other than SNOMED, @nullFlavor SHOULD be “OTH” and the other code SHOULD be placed in the transl     <style type="text/css">
        .constraintAdded {
            font-style: italic;
        }

        .constraintRemoved {
            text-decoration: line-through;
        }

        .constraintModified {
            font-weight: bold;
        }

<body ng-app="igViewApp">
    <div class="MainDiv" ng-controller="ViewCtrl">
        <nav class="navbar navbar-default navbar-static-top" id="navigation">
            <div class="container-fluid">
                <div class="navbar-header">
                    <button type="button" class="navbar-toggle collapsed" data-toggle="collapse" data-target="#navbar" aria-expanded="false" aria-controls="navbar">
                        <span class="sr-only">Toggle navigation</span>
                        <span class="icon-bar"></span>
                        <span class="icon-bar"></span>
                        <span class="icon-bar"></span>
                    </button>
                    <a class="navbar-brand" href="#/home">{{Model.ImplementationGuideName}} - {{Model.Status}} {{Model.PublishDate}}</a>
                </div>
                <div id="navbar" class="navbar-collapse collapse">
                    <ul class="nav navbar-nav navbar-right">
                        <li><a ng-click="EditOptions()">Options</a></li>
                        <li ng-if="!IsDownloaded"><a href="{{GetDownloadLocation()}}">Download</a></li>
                    </ul>
                    <form class="navbar-form navbar-right navbar-input-group">
                        <div class="form-group">
                            <input type="text" class="form-control" placeholder="Search text" ng-model="SearchText">
                        </div>
                        <button type="button" class="btn btn-primary" ng-click="Search()">Search</button>
                    </form>
                </div>
            </div>
        </nav>

        <div class="container-fluid">
            <span ng-repeat="bc in BreadCrumbs" style="line-break: strict">
                <span ng-if="$index > 0"> &gt; </span>
                <span><a href="{{bc.url}}" ng-click="SelectBreadCrumb($index)">{{bc.display}}</a></span>
            </span>

            <div ng-view autoscroll="true"></div>
        </div>

        <div class="loading-pane" ng-show="IsLoading">
            <div class="centered">Loading</div>
        </div>
    </div>

    <script type="text/html" id="resources.html">
        <h4>Resources instance in this implementation guide</h4>
        <ul>
            <li ng-repeat="r in Model.FHIRResources"><a href="#/resources/{{r.Name}}">{{r.Name}}</a></li>
        </ul>
    </script>

    <script type="text/html" id="resource.html">
        <h4 title="{{fileName}}">{{resource.name || resource.title || fileName}}</h4>
        <p ng-if="resource.description">{{resource.description}}</p>
        <div class="panel panel-default" ng-if="details">
            <div class="panel-body" ng-bind-html="details"></div>
        </div>
        <div class="row">
            <div class="col-md-6">
                <h5>JSON</h5>
                <copy-button></copy-button>
                <pre>{{json}}</pre>
            </div>
            <div class="col-md-6">
                <h5>XML</h5>
                <copy-button></copy-button>
                <pre>{{xml}}</pre>
            </div>
        </div>
    </script>

    <script type="text/html" id="template.html">
        <div ng-if="Template">
            <h1 class="page-header">
                <span>{{Template.Name}}</span>
            </h1>
            <h4>
                <span>[{{Template.Context}}: {{Template.Identifier}} ({{Template.Extensibility}})]</span>
                <i ng-if="IsDebug" class="glyphicon glyphicon-question-sign" uib-tooltip="{{Template}}" uib-tooltip-placement="bottom" uib-tooltip-trigger="click"></i>
            </h4>

            <p ng-bind-html="GetHtml(Template.Description)"></p>

            <div ng-if="!Options.TemplateTabs">

                <div class="panel panel-default">
                    <div class="panel-heading">
                        <a ng-click="Template.DiagramExpanded = !Template.DiagramExpanded" ng-class="{ collapsed: !Template.DiagramExpanded }">
                        UML Relationship Diagram
                        </a>
                    </div>
                    <div class="panel-body" ng-if="Template.DiagramExpanded">
                        <ig-diagram template="Template" model="Model"></ig-diagram>
                    </div>
                </div>

                <!-- Relationships -->
                <div class="panel panel-default" ng-if="HasRelationships(Template)">
                    <div class="panel-heading">
                        <h4 class="panel-title">
                            <a data-toggle="collapse" href="#{{GetPath()}}#relationships">
                            Relationships
                            </a>
                        </h4>
                    </div>
                    <div class="panel-body panel-collapse collapse" id="relationships">

                        <div ng-include="'template_relationships.html'"></div>
                    </div>
                </div>

                <!-- Constraints Table -->
                <div class="panel panel-default">
                    <div class="panel-heading">
                        <h4 class="panel-title">
                            <a data-toggle="collapse" href="#{{GetPath()}}#constrainttable">
                            Constraints Table
                            </a>
                        </h4>
                    </div>
                    <div class="table-responsive collapse in" id="constrainttable">
                        <div ng-include="'template_constraint_table.html'"></div>
                    </div>
                </div>

                <!-- Narrative Constraints -->
                <div class="panel panel-default">
                    <div class="panel-heading">
                        <h4 class="panel-title">
                            <a data-toggle="collapse" href="#{{GetPath()}}#narrativeconstraints">
                            Narrative Constraints
                            </a>
                        </h4>
                    </div>
                    <div class="panel-body panel-collapse collapse in" id="narrativeconstraints">
                        <div ng-include="'template_narrative.html'"></div>
                    </div>
                </div>

                <!-- Template Changes -->
                <div class="panel panel-default" ng-show="ShowTemplateChangesTab()">
                    <div class="panel-heading">
                        <h4 class="panel-title">
                            <a data-toggle="collapse"></a>
                            Changes in This Version

                        </h4>
                    </div>
                    <div class="panel-body panel-collapse collapse in" id="templatechanges">
                        <div ng-include="'template_changes.html'"></div>
                    </div>
                </div>


                <!-- Samples -->
                <h3 ng-if="Template.Samples.length > 0">Samples</h3>
                <div ng-include="'template_samples.html'"></div>

                <!-- Value Sets -->
                <h3 ng-if="CurrentValueSets.length > 0">Value Sets</h3>
                <div ng-include="'template_valuesets.html'"></div>
            </div>
            <uib-tabset ng-if="Options.TemplateTabs">
                <uib-tab heading="UML Relationship Diagram">
                    <ig-diagram template="Template" model="Model"></ig-diagram>
                </uib-tab>
                <uib-tab heading="Relationships">
                    <div ng-include="'template_relationships.html'"></div>
                </uib-tab>
                <uib-tab heading="Constraints Table">
                    <div ng-include="'template_constraint_table.html'"></div>
                </uib-tab>
                <uib-tab heading="Narrative Constraints">
                    <div ng-include="'template_narrative.html'"></div>
                </uib-tab>
                <uib-tab heading="Samples" ng-if="Template.Samples.length > 0">
                    <div ng-include="'template_samples.html'"></div>
                </uib-tab>
                <uib-tab heading="Value Sets" ng-if="CurrentValueSets.length > 0">
                    <div ng-include="'template_valuesets.html'"></div>
                </uib-tab>
            </uib-tabset>
        </div>
    </script>

    <script type="text/html" id="codesystems.html">
        <h1 class="page-header">Code systems in this guide</h1>

        <div class="table-responsive">
            <table class="table table-striped">
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Identifier</th>
                    </tr>
                </thead>
                <tbody>
                    <tr ng-repeat="cs in Model.CodeSystems">
                        <td><a id="{{cs.Identifier}}"></a>{{cs.Name}}</td>
                        <td>{{cs.Identifier}}</td>
                    </tr>
                </tbody>
            </table>
        </div>
    </script>

    <script type="text/html" id="valuesets.html">
        <h1 class="page-header">Value sets in this guide</h1>

        <div ng-repeat="vs in Model.ValueSets | orderBy: 'Name'">
            <a id="{{GetValueSetAnchor(vs)}}"></a>
            <div class="panel panel-default">
                <div class="panel-heading">
                    <a ng-click="vs.show = !vs.show" ng-class="{ collapsed: !vs.show }">
                        <strong>{{vs.Name}}</strong> {{vs.Identifier}}
                    </a>
                    <div class="pull-right valueset-date">{{vs.BindingDate}}</div>
                </div>
                <div class="table-responsive" ng-if="vs.show">
                    <table class="table table-striped">
                        <thead>
                            <tr>
                                <td colspan="4">
                                    <p>{{vs.Description}}</p>
                                    <p ng-if="vs.Source">
                                        <a href="{{vs.Source}}" target="_blank">{{vs.Source}}</a>
                                    </p>

                            </tr>
                            <tr>
                                <th>Code</th>
                                <th>Code System</th>

                                <td>{{vsm.CodeSystemIdentifier}}</td>
                                <td>{{vsm.DisplayName}}</td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    </script>

    <script type="text/html" id="volume2.html">

                                <td><a href="#{{GetPath()}}" ng-click="SetVolume2Filter('o')">o</a></td>
                                <td><a href="#{{GetPath()}}" ng-click="SetVolume2Filter('p')">p</a></td>

    <script type="text/html" id="template_hierarchy.html">
        <span class="glyphicon" ng-class="{ 'glyphicon glyphicon-plus': !template.Expanded, 'glyphicon glyphicon-minus': template.Expanded }" ng-if="template.Children.length > 0" ng-click="template.Expanded = !template.Expanded"></span>
        <a href="#/volume2/{{template.Bookmark}}" ng-class="{ 'no-children': template.Children.length == 0 }">{{template.Name}} <span class="label label-default">{{template.Identifier}}</a></span>
        <ul ng-if="template.Children.length > 0 && template.Expanded">
            <li ng-repeat="template in template.Children | orderBy: 'Name'" ng-include="'template_hierarchy.html'"></li>
        </ul>
    </script>

    <script type="text/html" id="search.html">
        <h1 class="page-header">Search Results</h1>

        <h2>Templates/Profiles</h2>
        <div class="search-template" ng-repeat="srt in SearchResults.Templates | orderBy: 'Priority' | orderBy: 'Name'">
            <p><strong><a href="#/volume2/{{srt.Template.Bookmark}}">{{srt.Name}} ({{srt.Template.Identifier}})</a></strong></p>
            <p class="search-description" ng-bind-html="GetHtml(srt.Template.Description)"></p>
        </div>

        <h2>Constraints</h2>
        <p ng-repeat="srt in SearchResults.Constraints">
            {{srt.Template.Name}} ({{srt.Template.Identifier}})<br />
            <a href="#/volume2/{{srt.Template.Bookmark}}/{{srt.Constraint.Number}}" ng-bind-html="GetHtml(srt.Constraint.Narrative)"></a>
        </p>

        <h2>Value Sets</h2>
        <p ng-repeat="srt in SearchResults.ValueSets | orderBy: 'Priority' | orderBy: 'Name'">
            <a href="#/valuesets#{{srt.ValueSet.Identifier}}">{{srt.Name}} ({{srt.ValueSet.Identifier}})</a>
        </p>

        <h2>Code Systems</h2>
        <p ng-repeat="srt in SearchResults.CodeSystems | orderBy: 'Priority' | orderBy: 'Name'">
            <a href="#/codesystems#{{srt.CodeSystem.Identifier}}">{{srt.Name}} ({{srt.CodeSystem.Identifier}})</a>
        </p>
    </script>

    <script type="text/html" id="home.html">
        <!-- TODO: Separate field to capture display name -->
        <h2 class="page-header">Welcome to the Web-based Implementation Guide for {{Model.ImplementationGuideDisplayName}}</h2>

        <h3>Table of Contents</h3>
        <h4><span class="glyphicon glyphicon-book"></span> <a href="#overview">Overview</a></h4>
        <h4><span class="glyphicon glyphicon-list-alt"></span> <a href="#volume2">Templates/Profiles</a></h4>
        <h4 ng-if="Model.FHIRResources && Model.FHIRResources.length > 0"><span class="glyphicon glyphicon-registration-mark"></span> <a href="#resources">Resources</a></h4>
        <h4><span class="glyphicon glyphicon-list"></span> <a href="#valuesets">Value sets in this guide</a></h4>
        <h4><span class="glyphicon glyphicon-list"></span> <a href="#codesystems">Code systems in this guide</a></h4>

        <p ng-bind-html="GetHtml(Model.ImplementationGuideDescription)"></p>
    </script>

    <script type="text/html" id="overview.html">
        <h1 class="page-header">Overview</h1>
        <div ng-if="Model.Volume1Html">
            <div ng-bind-html="GetHtml(Model.Volume1Html)"></div>
        </div>
        <div class="volume1-content" ng-if="Model.Volume1Sections.length > 0" numbered-heading="Model.Volume1Sections" fix-html-content="Model.Volume1Sections">
            <h2 class="nocount">Table of Contents</h2>
            <ol class="table-of-contents" />

            <hr />

            <div ng-repeat="s in Model.Volume1Sections">
                <div class="animate-switch-container" ng-switch on="s.Level">
                    <h2 ng-switch-when="2" id="section{{$index+1}}">{{s.Heading}}</h2>
                    <h3 ng-switch-when="3" id="section{{$index+1}}">{{s.Heading}}</h3>
                    <h4 ng-switch-when="4" id="section{{$index+1}}">{{s.Heading}}</h4>
                    <h5 ng-switch-when="5" id="section{{$index+1}}">{{s.Heading}}</h5>
                    <h6 ng-switch-when="6" id="section{{$index+1}}">{{s.Heading}}</h6>
                    <h1 ng-switch-default id="section{{$index+1}}">{{s.Heading}}</h1>
                </div>
                <div ng-bind-html="GetHtml(s.Content)"></div>
            </div>
        </div>
    </script>

    <script type="text/html" id="template_relationships.html">
        <div ng-if="Template.ContainedTemplates.length > 0">
            <u>Contains</u>
            <ul>
                <li ng-repeat="tr in Template.ContainedTemplates | orderBy: 'Name'"><a href="#/volume2/{{tr.Bookmark}}">{{tr.Name}} ({{tr.Identifier}})</a></li>
            </ul>
        </div>
                            
        <div ng-if="Template.ContainedByTemplates.length > 0">
            <u>Contained By</u>
            <ul>
                <li ng-repeat="tr in Template.ContainedByTemplates | orderBy: 'Name'"><a href="#/volume2/{{tr.Bookmark}}">{{tr.Name}} ({{tr.Identifier}})</a></li>
            </ul>
        </div>    

        <div ng-if="Template.ImpliedTemplate">
            <u>Implies</u>
            <ul>
                <li><a href="#/volume2/{{Template.ImpliedTemplate.Bookmark}}">{{Template.ImpliedTemplate.Name}} ({{Template.ImpliedTemplate.Identifier}})</a></li>
            </ul>
        </div>
                                
        <div ng-if="Template.ImplyingTemplates.length > 0">
            <u>Implied By</u>
            <ul>
                <li ng-repeat="tr in Template.ImplyingTemplates | orderBy: 'Name'"><a href="#/volume2/{{tr.Bookmark}}">{{tr.Name}} ({{tr.Identifier}})</a></li>
            </ul>
        </div>
    </script>

    <script type="text/html" id="template_constraint_table.html">
        <table class="table table-striped">
            <thead>
                <th>XPath</th>
                <th>Card.</th>
                <th>Verb</th>
                <th>Data Type</th>
                <th>CONF #</th>
                <th>Value</th>
            </thead>
            <tbody>
                <tr ng-if="Template.ImpliedTemplate">
                    <td colspan="6">
                        Conforms to <a href="#/volume2/{{Template.ImpliedTemplate.Bookmark}}">{{Template.ImpliedTemplate.Name}} (identifier: {{Template.ImpliedTemplate.Identifier}})</a>
                    </td>
                </tr>
                <tr ng-repeat="tc in CurrentTableConstraints">
                    <td>
                        <span style="white-space: pre">{{tc.Level}}</span>
                        <span>{{tc.Constraint.Context}}</span>
                    </td>
                    <td>{{tc.Constraint.Cardinality}}</td>
                    <td>{{tc.Constraint.Conformance}}</td>
                    <td>{{tc.Constraint.DataType}}</td>
                    <td>{{tc.Constraint.Number}}</td>
                    <td ng-bind-html="GetConstraintTableValue(tc.Constraint)"></td>
                </tr>
            </tbody>
        </table>
    </script>

    <script type="text/html" id="template_narrative.html">
        <ol>
            <li ng-if="Template.ImpliedTemplate">Conforms to <a href="#/volume2/{{Template.ImpliedTemplate.Bookmark}}">{{Template.ImpliedTemplate.Name}} (identifier: {{Template.ImpliedTemplate.Identifier}})</a></li>
            <li ng-repeat="c in Template.Constraints" ng-include="'narr_constraint_render.html'"></li>
        </ol>
    </script>

    <script type="text/html" id="inline_constraint_change.html">
        <div class="row" ng-attr-title="{{ $parent.GetChangeTooltip(c.ChangeType) }}">
            <div class="col-md-12">
                <span>{{ $index + 1 }}</span>. <span ng-class="{ 'constraintAdded': c.ChangeType == 0, 'constraintModified': c.ChangeType == 1, 'constraintRemoved': c.ChangeType == 2 }">{{ c.Narrative }}</span>
            </div>
        </div>

        <div style="padding-left: 40px" ng-repeat="c in c.Constraints" ng-include="'inline_constraint_change.html'"></div>
    </script>

    <script type="text/html" id="template_changes.html">
        <p><b>From: </b> {{ Template.Changes.PreviousTemplateName }}</p>

        <div class="input-group">
            <input type="radio" name="ViewChangesInline" value="Inline" ng-model="ViewTemplateChangesMode" /> Inline
            <input type="radio" name="ViewChangesInline" value="List" ng-model="ViewTemplateChangesMode" /> List
        </div>

        <div class="well" ng-if="ViewTemplateChangesMode == 'Inline'">
            <div ng-repeat="c in Template.Changes.InlineConstraints" ng-include="'inline_constraint_change.html'"></div>
        </div>

        <div class="well" ng-if="ViewTemplateChangesMode == 'List'">
            <h4>Template Changes</h4>
            <div class="container-fluid">
                <div class="row">
                    <div class="col-md-2"><strong>Field</strong></div>
                    <div class="col-md-5"><strong>Old</strong></div>
                    <div class="col-md-5"><strong>New</strong></div>
                </div>
                <div class="row" ng-repeat="cf in Template.Changes.Difference.ChangedFields">
                    <div class="col-md-2">{{ cf.Name }}</div>
                    <div class="col-md-5">{{ cf.Old }}</div>
                    <div class="col-md-5">{{ cf.New }}</div>
                </div>
            </div>

            <h4>Constraint Changes</h4>
            <div class="container-fluid">
                <div class="row">
                    <div class="col-md-2"><strong>Change</strong></div>
                    <div class="col-md-2"><strong>Number</strong></div>
                    <div class="col-md-4"><strong>Old Narrative</strong></div>
                    <div class="col-md-4"><strong>New Narrative</strong></div>
                </div>
                <div class="row" ng-repeat="cc in Template.Changes.Difference.ChangedConstraints"  ng-show="cc.Type !== 3">
                    <div class="col-md-2">{{ $parent.GetChangeTooltip(cc.Type) }}</div>
                    <div class="col-md-2">{{ cc.Number }}</div>
                    <div class="col-md-4">{{ cc.OldNarrative }}</div>
                    <div class="col-md-4">{{ cc.NewNarrative }}</div>
                </div>
            </div>
        </div>
    </script>

    <script type="text/html" id="template_samples.html">
        <div class="panel panel-default" ng-repeat="s in Template.Samples">
            <div class="panel-heading">
                <h4 class="panel-title">
                    <a data-toggle="collapse" href="#{{GetPath()}}#sample{{s.Id}}">
                    {{s.Name}}
                    </a>
                </h4>
            </div>
            <div class="panel-body panel-collapse collapse" id="sample{{s.Id}}">
                <div hljs source="s.SampleText"></div>
            </div>
        </div>
    </script>

    <script type="text/html" id="template_valuesets.html">
        <div ng-repeat="vs in CurrentValueSets | orderBy: 'Name'">
            <a id="{{GetValueSetAnchor(vs)}}"></a>
            <div class="panel panel-default value-set">
                <div class="panel-heading" ng-if="!Options.TemplateTabs">
                    <a data-toggle="collapse" href="#{{GetPath()}}#vs_{{GetElementIdentifier(vs.Identifier)}}">
                        {{vs.Name}} {{vs.Identifier}}
                    </a>
                </div>
                <div class="panel-heading" ng-if="Options.TemplateTabs">
                    {{vs.Name}} {{vs.Identifier}}
                </div>
                <div class="table-responsive" ng-class="{ collapse: !Options.TemplateTabs }" id="vs_{{GetElementIdentifier(vs.Identifier)}}">
                    <table class="table table-striped">
                        <thead>
                            <tr>
                                <td colspan="4">
                                    <p><strong>Binding Date:</strong> {{vs.BindingDate}}</p>
                                    <p>{{vs.Description}}</p>
                                    <p ng-if="vs.Source">
                                        <a href="{{vs.Source}}" target="_blank">{{vs.Source}}</a>
                                    </p>
                                </td>
                            </tr>
                            <tr>
                                <th>Code</th>
                                <th>Code System</th>
                                <th>Code System Identifier</th>
                                <th>Display</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr ng-repeat="vsm in vs.Members">
                                <td>{{vsm.Code}}</td>
                                <td>{{vsm.CodeSystemName}}</td>
                                <td>{{vsm.CodeSystemIdentifier}}</td>
                                <td>{{vsm.DisplayName}}</td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    </script>

    <script type="text/html" id="narr_constraint_render.html">
        <div class="constraint" ng-bind-html="GetHtml(c.Narrative)"></div>
        <ol>
            <li ng-repeat="c in c.Constraints" ng-include="'narr_constraint_render.html'"></li>
        </ol>
    </script>

    <script type="text/html" id="options_modal.html">
        <div class="modal-header">
            <h3 class="modal-title">Options</h3>
        </div>
        <div class="modal-body">
            <div class="form-group" ng-if="AllowDataChanges">
                <label>Include inferred?</label>
                <select class="form-control" ng-model="Options.Inferred" ng-options="o.v as o.n for o in [{ n: 'Yes', v: true }, { n: 'No', v: false }]">
                </select>
            </div>
            <div class="form-group" ng-if="AllowDataChanges">
                <label>Parent templates/profiles</label>
                <select class="form-control" ng-repeat="pt in Options.ParentTemplates" ng-options="t.Id as t.Name for t in Templates" ng-model="Options.ParentTemplates[$index]">
                    <option value="">SELECT</option>
                </select>
            </div>
            <div class="form-group">
                <label>Use tabs when viewing templates/profiles?</label>
                <select class="form-control" ng-model="Options.TemplateTabs" ng-options="o.v as o.n for o in [{ n: 'Yes', v: true }, { n: 'No', v: false }]">
                </select>
            </div>
        </div>
        <div class="modal-footer">
            <button class="btn btn-primary" ng-click="Ok()">OK</button>
            <button class="btn btn-warning" ng-click="Cancel()">Cancel</button>
        </div>
    </script>

    <script type="text/javascript" src="js/ui-bootstrap-tpls-2.5.0.min.js"></script>
    <script type="text/javascript" src="js/highlight.min.js"></script>
    <script type="text/javascript" src="js/angular-highlight.min.js"></script>
    <script type="text/javascript" src="js/lodash.min.js"></script>
    <script type="text/javascript" src="js/backbone-min.js"></script>
    <script type="text/javascript" src="js/joint.min.js"></script>
    <script type="text/javascript" src="js/graphlib.core.min.js"></script>

</body>
